This term is very heavily used to scare young minds, need not be afraid of it.
It's a day to day thing if you're into Software Engineering or any programming related stuff.
.
Imagine your Instagram loading for 10-20 minutes browsing through billions and billions of results and then providing you your profile.
You would never use Instagram again.
But people like Uncle Mark, came up with efficient solutions, and those solutions are called Competitive Programming.
Any normal Joe or Ramesh/Suresh can do this but, it will require PATIENCE and PRACTICE
.
We will talk more about it in Part 2.

Have seen a lot of people struggling through programming interviews and here are a few things that make it more difficult for us to get used to programming interviews.

1. Steep Learning Curve
- We need to admit, it's hard to difficult to explore the unknown, and if you're not having a mentor, it's very difficult. 
- People tend to give up which is what I don't want you to do.
- CS is a beautiful journey, and Competitive programming is a very crucial part of it.

2. Questions are NOT DIRECT
- I hate this part, but it is the way it is, interviewers tend to add unwanted hurdles into the question which might confuse the interviewee and even if you're aware of the solution you are not able to solve it
- We can't do anything about it other than practicing it every day.

3. Constant Comparison
- Sharma Ji's son is no smarter than you, he just did more practice and with luck he got into Flipcart
- If you practice you can get into Google, Facebook, Amazon or Netflix

4. Learning the hard way
- Instead of solving more problems, try to look for patterns.
- Patterns will help you find solution's quicker, and interviewers really appreciate that.

5. Quantity over quality
- Try doing a variety of topics, but need to make sure you master them
- If you don't understand the solution, don't mark it as finished, but revisit them, ask and try to understand thoroughly.
